(50, 'faq.element', '{\"question\":\"What is a Virtual Private Server (VPS)?\",\"answer\":\"A Virtual Private Server is a server divided into fully separate hosting environments. When you have VPS hosting, one of those environments is completely dedicated to you. That means you don\'t have to share resources (such as RAM or CPU) with other customers and you\'re less likely to be impacted by their behavior.\"}', '2023-01-14 12:33:55', '2023-12-16 12:36:35'),
(51, 'faq.element', '{\"question\":\"What about VPS vs. Dedicated?\",\"answer\":\"Another great question. A dedicated server is a server that\'s literally dedicated to you and no one else, which means the world (or in this case, server) is your oyster.\"}', '2023-01-14 12:34:08', '2023-12-16 12:37:31'),
